import React from 'react';
import SHOP_DATA from './shop.data';
import collection_preview from '../../components/collection-preview/collection-preview.component';

class ShopPage extends React.Component {

    constructor(props) {
        super(props);
        this.state = {
            collections: SHOP_DATA
        }
    }

    render() {
        const {collections} = this.state
        return (
            <div>
                collections.map(collection => 
                <collection_preview key={collection.id}>{
                title = collection.title, {...otherProps}}</collection_preview>
            </div>

        )
    }
}

export default ShopPage;
